import "./App.css";
import Translate from "./components/Translate";
import Search from "./components/Search";

function App() {
  return (
    <div className="App">
      <head>
        <script
          src="https://kit.fontawesome.com/a076d05399.js"
          crossorigin="anonymous"
        ></script>
      </head>
      <header className="App-header">
        <Translate></Translate>
        <Search></Search>
      </header>
    </div>
  );
}

export default App;
